            join doeat_delivery_production.team_order t on o.team_order_id = t.id
            where orderyn=1
            and t.is_test_team_order = 0
            and o.paid_at is not null
            and o.delivered_at is not null
)
                
select
    u.user_group
    , d.hour ||':00-'|| d.hour ||':59' as 
    , count(distinct u.user_id) as _
     , count(distinct a.user_id ) as __
     , count(distinct b.user_id) as __
     , __*100.0/NULLIF(_,0) as aoc
    , __*100.0/NULLIF(__,0) as _bc
from p_user u
cross join (select '10' as hour union all
            select '11' union all select '12' union all select '13' union all
            select '14' union all select '15' union all select '16' union all
            select '17' union all select '18' union all select '19'
            ) d

left join (select user_id
                , extract(hour from created_at) as hour
                , count(a.log_type) as log_cnt
                 from doeat_data_mart.user_log a
                where date(a.created_at) = '2025-06-24'
                group by 1,2
                ) a on a.user_id = u.user_id and a.hour=d.hour
left join (select o.order_id
                , o.created_at::date as date
                , extract(hour from o.created_at) as hour
                , o.user_id
                from p_order o
                join doeat_delivery_production.item i on i.order_id = o.order_id
                join doeat_delivery_production.doeat_777_product p on p.id = i.product_id
                where o.type = 'CURATION_PB'
                and p.menu_name like '%%'
                and date(o.created_at) = '2025-06-24'
                   ) b on b.user_id = u.user_id and b.hour = d.hour
group by 1,2
order by 2,1




